import React from "react";
import "./Card.scss";
import { Link } from "react-router-dom";

const Card = ({ item }) => {
	return (
		<>
			<link to={`/product/${item.id}`}>
				<div className="Card">Card</div>;
			</link>
			;
		</>
	);
};

export default Card;
